const candidatesData = {
    mla: [
        { name: "Candidate A", party: "Party X", symbol: "data:image/jpeg;base64," },
        { name: "Candidate B", party: "Party Y", symbol: "data:image/jpeg;base64," },
    ],
    mlc: [
        { name: "Candidate C", party: "Party Z", symbol: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSXTfa98G0ECE9HEPGEgJyg3NKIHaRsTG_a4Q&s" },
        { name: "Candidate D", party: "Party W", symbol: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQLfYlZPQV7hnEZOvyQ0TTbzhWwfEXmua-jvA&s" },
    ]
};

let selectedCandidate = '';

function authenticateFingerprint() {
    const username = document.getElementById("username").value;
    const voterId = document.getElementById("voterId").value;

    if (username && voterId) {
        alert("Fingerprint authentication successful!");
        document.getElementById("checkmark").style.display = "block"; // Show checkmark
        setTimeout(() => {
            document.getElementById("login-section").style.display = "none";
            document.getElementById("election-section").style.display = "block";
        }, 1000);
    } else {
        alert("Please enter Username and Voter ID first.");
    }
}

function enableConfirmButton() {
    document.getElementById("confirm-election").disabled = false;
}

function showCandidatesSection() {
    document.getElementById("election-section").style.display = "none";
    const electionType = document.querySelector('input[name="election"]:checked').value;
    loadCandidates(electionType);
    document.getElementById("candidates-section").style.display = "block";
}

function loadCandidates(electionType) {
    const candidatesList = document.getElementById("candidates-list");
    candidatesList.innerHTML = "";

    candidatesData[electionType].forEach(candidate => {
        const candidateDiv = document.createElement("div");
        candidateDiv.classList.add("candidate");

        const candidateImg = document.createElement("img");
        candidateImg.src = candidate.symbol;
        candidateImg.alt = `${candidate.party} Symbol`;

        const candidateInfo = document.createElement("div");
        candidateInfo.innerHTML = `<strong>${candidate.name}</strong> - ${candidate.party}`;

        const candidateRadio = document.createElement("input");
        candidateRadio.type = "radio";
        candidateRadio.value = candidate.name;
        candidateRadio.name = "candidate";
        candidateRadio.onclick = () => selectedCandidate = candidate.name;

        candidateDiv.appendChild(candidateRadio);
        candidateDiv.appendChild(candidateImg);
        candidateDiv.appendChild(candidateInfo);
        candidatesList.appendChild(candidateDiv);
    });
}

function submitVote() {
    if (!selectedCandidate) {
        alert("Please select a candidate.");
        return false;
    }
    document.getElementById("candidates-section").style.display = "none";
    document.getElementById("summary-text").textContent = `You have selected: ${selectedCandidate}`;
    document.getElementById("confirmation-section").style.display = "block";
    return false;
}

function showHomePage() {
    document.getElementById("confirmation-section").style.display = "none";
    document.getElementById("home-section").style.display = "block";
    document.querySelector(".thank-you").style.display = "block";
}
